import styled from "styled-components";
import Card from "../components/Card/Card"
import { FaCaretDown } from "react-icons/fa";


type CategoriesProps = {
    headerText: string,
}
const ClothingList = styled.ul`
list-style-type: none;
border-right: 1px solid black;
width: 150px;

`

const GridView = styled.div`
padding-left: zem;
padding-right: 10em;
width: 100%;
display: inline-grid;
grid-template-columns: repeat( auto-fit, minmax(250px, 1fr) );
grid-column-gap: 10rem;

`
const CategoriesHeader = styled.h1`
text-align: center;
`
const FlexBoxHolder = styled.div`
    display: flex;
    margin-bottom
`

const NavigationFlexBox = styled.div`
    display: flex;
    justify-content: center;
    margin-bottom: 1rem;
`

const NavHolder = styled.div`
background-color: #D3D3D3;
display: flex;
justify-content: center;
padding: 1rem;
width: 125px;
text-align: center;
margin-left: 1rem;

`

const randomPicture = "https://api.lorem.space/image/movie?w=344&h=374"
  ;


const CategoriesComponent = (props: CategoriesProps) => {
    return (
        <>
        <CategoriesHeader>{props.headerText}</CategoriesHeader>
        <NavigationFlexBox>
        <NavHolder>
            <label className="button">Storlek
            <span><FaCaretDown/></span></label>
            </NavHolder>
            <NavHolder>
            <label className="button">Pris
            <span><FaCaretDown/></span></label>
            </NavHolder>
            <NavHolder>
            <label className="button">Märke
            <span><FaCaretDown/></span></label>
            </NavHolder>
            <NavHolder>
            <label className="button">Popularitet
            <span><FaCaretDown/></span></label>
            </NavHolder>
            </NavigationFlexBox>
        <FlexBoxHolder>
            <aside>
        <ClothingList>

            <li>ALLA PRODUKTER</li>
            <li>NYHETER</li>
            <li>Accessoarer</li>
            <li>Byxor</li>
            <li>Shorts</li>
            <li>Tröjor</li>
            <li>Hoodies</li>
            <li>Alla produkter</li>
            <li>Nyheter</li>
            <li>Accessoarer</li>
            <li>Byxor</li>
            <li>Shorts</li>
            <li>Tröjor</li>
            <li>Hoodies</li>

        </ClothingList>
        </aside>
        <GridView>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        <Card imgUrl={randomPicture} title="Clothing item title" description="$50.00 USD"/>
        </GridView>
        </FlexBoxHolder>
        </>
    )
}


export default CategoriesComponent;
